description:
IMDB: World War II drama in which Richard Widmark, as Lt. Cmdr. John Lawrence, replaces the popular commanding officer of a group of underwater demolition divers. a crew of fiercely independent studs who hang their proverbial hats in Davy Jones' locker. The martinet Lawrence tightens the discipline of the unit, making him mucho unpopular with the macho frogmen. Finally, Lawrence proves himself as more than just a stuffed white shirt, showing he has the cojones to keep up with their peculiar brand of the jones, becoming one of the team by fearlessly defusing a live torpedo at the risk of his own life.
